    and address of every donor that gave over $200 in the calendar year.  The Committee's
    established best efforts policy is as follows:  1. The donor is requested to provide
    this information during the original solicitation. The required federal disclaimers
    are included in all printed materials.  2.  Once the contribution is received
    with missing information the Committee sends a combination of e-mails and phone
    calls to the donor. 3.  If the information is not recieved during the previous
    step, a letter is sent to the donor.  In the event that additional information
    is received from these individuals it will be provided to the Commission.      3.The
    employer and occupation has been corrected for the individuals referenced by the
    Commission.      4.  The receipt on Line 11(c) from the Friends of Jim Clyburn
    was a transfer from that committee and has now been labeled as such.     5.  All
    transfers from National Party Committees were segregated in a special account.
